import React from 'react'
import '../../App.css';
import Footer from '../Fotter';

function SignUp() {
    return (
        <>
        <h1 className = 'sign-up'>Enter Your Email below ASAP.....</h1>

        <Footer/>
        </>
    )
}

export default SignUp;
